import axios from "axios";

export const getProducts = () => {
  return new Promise((onSuccess, onFail) => {
    axios
    .get("api/products")
    .then((response, error) => {
      if (!response || error) {
        return onFail(`Response failure : ${error}`);
      }
      onSuccess(response => response.data)
      console.log(response.data) //return promise response
    })


  });

};
